  let begin = UnsafeRawPointer(begin).assumingMemoryBound(to: Int32.self)
  return withUnsafePointer(to: &end) { end -> OpaquePointer in
    let end = UnsafeRawPointer(end).assumingMemoryBound(to: Int32.self)
